javascript:(function(){const e=t=>[...t.classList].some(t=>/^css-.*-diff-removed$/.test(t)),r=Array.from(document.querySelectorAll("tr"));let o=0,s=0,a=0;for(const t of r){const r=Array.from(t.querySelectorAll(":scope > td, :scope > th")),c=r.filter(e);if(c.length>0){for(const e of r)c.includes(e)|| (e.remove(),s++);o++}}const c=new Set;for(const e of r){if(!e.querySelector("td[class*='diff-removed']")){const r=e.innerHTML.trim();c.has(r)?(e.remove(),a++):c.add(r)}}console.log(`âœ… Done. Rows changed: ${o}, cells removed: ${s}, duplicate rows removed: ${a}.`);})();
